import React from 'react';
import { Link } from 'react-router-dom';
import PizzaCard from './PizzaCard'

const PizzaCardList = (pizzas) => {
	const PizaComponent = pizzas.map((pizza, i) => {
    return (
      <PizzaCard key={i}
        id={pizza[i].id}
        unit={pizza[i].unit}
        name={pizza[i].name} />
    )
  })
  return (
  	<div className="AllSabores">
  	{PizaComponent}
    </div>
  );
};

export default PizzaCardList;
